;; **
;;; ## Encoder
;; **

;; @@
(def allow-chars
  " abcdefghijklmnopqrstuvwxyz0123456789.?!,")

(def bits-per-char 2)

(def window-size 5)

(println "encoder bits:" (* window-size bits-per-char (count allow-chars)))

(defn train-inputs
  [text]
  (->> text
       (partition window-size 1)))

(def txt-window-encoder
  (e/encat
    (repeat window-size (e/category-encoder [(* bits-per-char (count allow-chars))]
                                  (seq allow-chars)))))

[(viz txt-window-encoder "aaaaaa!")
 (viz txt-window-encoder (first (train-inputs text1)))
 (apply str (first (train-inputs text1)))]
