;; **
;;; ## HTM model
;; **

;; @@
(def spec
  {:column-dimensions [400]
   :global-inhibition? true
   :ff-init-frac 0.5
   :activation-level (float (/ 5 400))
   :depth 1
   :lateral-synapses? false
   :distal {:learn? false} ;; begin with only spatial pooling
   :proximal {:perm-inc 0.01
              :perm-dec 0.01}})

(def model (core/regions-in-series
            1 core/sensory-region
            [spec] {:input [[] txt-window-encoder]}))

(time
  (def trained
    (reduce htm-step-with-progress model (train-inputs text1))))

