;; **
;;; ### Receptive fields
;; **

;; @@
(defn order-of
  [xs]
  (->> xs
       (map-indexed vector)
       (sort-by second >)
       (map first)))

(order-of [5 1 2 3 4])

(defn poss-values
  [predictions]
  (->> predictions
       (sort-by :votes-frac >)
       (filter #(>= (:votes-frac %) 1/4))
       first
       :value))

(sort
(let [lyr (get-in trained [:regions :rgn-0 :layer-3])]
  (for [col (take 20 (order-of (:active-duty-cycles lyr)))]
    (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
      (apply
        str
        (for [pos-decode (p/decode txt-window-encoder (zipmap inbits (repeat 1)) 3)]
         (or (poss-values pos-decode)
             \_))))))
)
