;; <=

;; **
;;; #### Information content / correlation
;; **

;; **
;;; For each column, find its greatest overlap with any other column.
;;; Look at the distribution of these "redundancies" over all columns.
;;; Could also do some clustering...
;; **

;; @@

(def rfs
  (let [lyr (get-in trained [:regions :rgn-0 :layer-3])]
    (for [col (range (p/size-of lyr))]
      (let [inbits (keys (core/cells-proximal-bit-votes lyr [[col 0]]))]
        (set inbits)))))

(def redundancies
  (for [[col col-rf] (map-indexed vector rfs)
        :let [other-rfs (concat (take col rfs)
                                (drop (inc col) rfs))]]
    (->> other-rfs
         (map #(/ (count (set/intersection % col-rf)) (count col-rf)))
         (reduce max)
         (* 100.0)
         (long))))

(table-view
[["Redundancies of columns: maximum % overlap with some other column"
  "Number of connected synapses (receptive field) of columns"
  ]
 [
  (plot/histogram redundancies :plot-size 240)
  (let [freqs (frequencies (map count rfs))]
    (plot/bar-chart (keys (sort freqs)) (vals (sort freqs))
                    :plot-size 240))
  ]
 ]
)
