;; <=

;; **
;;; Over active columns, look at numbers of active inputs driving them.
;; **

;; @@
;; 
;; @@

;; **
;;; Over active input bits, look at numbers of active columns being driven by them.
;; **

;; @@
;; sequence of [inval, for each active inbit: number of connected active columns]

(def active-outgoing-ts
 (for [inval (take 50 (drop 399 (train-inputs text1)))]
   (let [this-htm (-> trained
                      (p/htm-sense inval nil)
                      (p/htm-activate))
         lyr (get-in this-htm [:regions :rgn-0 :layer-3])
         inbits (set (-> this-htm :senses :input p/bits-value))
         a-cols (p/active-columns lyr)
         ;; map from bit index to number of connected active columns
         bit-cols (->> (map vector a-cols (repeat 0))
                       (core/cells-proximal-bit-votes lyr))]
     [inval
      (count a-cols)
      (map (fn [i]
            (bit-cols i 0))
          inbits)
      ]))
)

(first active-outgoing-ts)

(def all-outgoing
  (->> active-outgoing-ts
       (map #(nth % 2))
       (apply concat)))

(println "mean number of connected active columns for each inbit:"
         (float (mean all-outgoing))
         \newline
         "fraction of active inbits driving no columns:"
         (float (/ (count (filter zero? all-outgoing))
                   (count all-outgoing)))
         \newline
         "mean number of connected active columns for each EFFECTIVE inbit (excludes ignored bits):"
         (float (mean (filter pos? all-outgoing))))

(def plot-ns (range 6))

(table-view
 (for [[inval n-cols bit-col-ns] active-outgoing-ts]
   (let [freqs (frequencies bit-col-ns)]
     [(apply str inval)
      n-cols
      (count bit-col-ns)
      (-> (plot/bar-chart plot-ns
                          (map freqs plot-ns (repeat 0))
                          :plot-size 80
                          :aspect-ratio 2)
          (update-in [:content :axes] (partial filterv #(not= "y" (:type %)))))
      ]))
  :columns '[inval n-cols n-bits "inbits: connected active columns"]
)

