;; **
;;; ### Reconstruction
;; **

;; @@
(table-view
(for [inval (take 100 (drop 399 (train-inputs text1)))
      :let [this-htm (-> trained
                         (p/htm-sense inval nil)
                         (p/htm-activate))
            lyr (get-in this-htm [:regions :rgn-0 :layer-3])]]
    [(apply str inval)
     (->> (core/predictions this-htm :input 3 p/active-cells)
          (map #(or (poss-values %) \_))
          (apply str))
    ]
  )
)
