;; **
;;; ### Reconstruction error
;; **

;; **
;;; #### As fraction of reconstructed characters incorrect
;; **

;; @@
(->>
  (for [inval (take 100 (drop 399 (train-inputs text1)))
      :let [this-htm (-> trained
                         (p/htm-sense inval nil)
                         (p/htm-activate))
            lyr (get-in this-htm [:regions :rgn-0 :layer-3])]]
    (->>
      (map =
         inval
         (->> (core/predictions this-htm :input 3 p/active-cells)
              (map poss-values)))
      (remove true?)
      (count)))
  (map #(/ % window-size))
  (mean)
  (float))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>0.262</span>"}
;; <=

;; **
;;; #### As fraction of reconstructed bits incorrect
;; **

;; @@
(bits-reconstruction-error trained (take 20000 (train-inputs text1)))
